import React from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

function TotalStoryPointBarChart() {
  return (
    <BarChart
      xAxis={[{ scaleType: 'band', data: ['group A', 'group B', 'group C'] }]}
      series={[1, 2, 3]}
      width={500}
      height={300}
    />
  );
}

export default TotalStoryPointBarChart;
